mein Innres in eine qualvolle  Zerrüttung gesetzt;
              schon lange hat das Andenken meines unglücklichen Vaters alle Ruhe aus meiner Seele
              verwiesen.

Eine Liebe, wie die seinige, kann durch lärmende Ausschweifungen übertäubt, niemals
